  "advertisements": [
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "1. Bev weme extra schöne frische Damascene Weertrauben ohne Kernen in billigem Preis und beileibiger Quantität zu haben, ift im Bes richtshaus obne Entgeld zu vernehmen."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "2. Ein Juden-Kaufferey; Item ein Stückels Eein mit einem Stück in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "3. Bey Jungfr. Mengern an der Burggasse find frische angefangene neue Dichtings in billigem Preis zu haben."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "4. Im Gasthof zur Blumen ift gutter alter hönig die Maas a 1 ½ Pfunden Nem Endt a 2 Se, der Centner. Beyne schöne gelbe Bienen in billigem Preis zu haben."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "5. Bey weme schöne gelbe, weisse und schödeligte Canarien-Bögelchen Männli. und Weibli. in billigem Preis zu haben, ift im Berichtshaus zu vernehmen."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "6. Nicht Saum guter rother alter Randwein a 10 Stund der Saum. Solte er aber zugleich mit einander genommen werden a 9 Pfund, will man das Stücklein gern auf einmal fahren möchte; Er wäre täglich für einen Wirth in der Stadt oder auf der Landshaft, wohon Musier zu haben bey Herrn Franß Lucad Ein, der dem Küfer in der kleinen Stadt, leyder aber nicht lang Nerzig."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "7. Bey Frau Steinbrunn in klein Basel find ungefärbe ; Saum rother ErenzägersBein von 1753, davon man Dömenbeis haben kan; folte er aber mit einander genommen werden, so würde man fehr billigen Preis machen."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "8. Ein Stück schönes ferneidiges unüberzeiget Endt gleich vor dem Richentor, und ift id darum bey Herrn Notariats=Rath Möbiner auf dem Rebberg anzumelden."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "9. Eine Bäffel=Mier mit einer Feder und schönen Gebäu, die 8 Tag gelt und Wietler repetirt, in billigem Preis, im Berichtshaus zu erfahren."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "10. Sehen Saum weiffer Marggräfer Böler=Bein von 1753, in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "11. Eine schöne nußhahmene Beffhäfen für 2 Verjonen, mit Sträuben, Item eine Gaffe von bösem eichenem Bolk, 4 Währ angereist, auch mit einem richt gutten Cabes und Cafene, ten zu einem Mrauflog mit richen Ebängen wohl beibhagen, an Dödel inwendig mit Goden, auf einem grünen Fufs, a 6 Wthnd. Ein Seelen=Seater fant 2 Gbillen, Seel, Sträuben, Stein und Zugehördt; Wenn eine große tupferne Cathederolle faft neu, bies eine tiefe Judlein=Dranne; 3wo noch fast neue Bollen, wohl mit hartem Eifen versehen fant einer Seite, Seil und Etcin, alles in billigem Preis, im Berichtshaus obne Entgeld zu erfragen."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "12. Bey Meifter Daniel Büsler im Doctor.Gass ten find schöne Humaniten=Bürgen und guth Goldt=Füper über Narcifius Indicus Jacobes in billigem Preis zu haben."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "13. Ein modernfartes tüchgenes Kleid in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "14. Bey einem Bütten einmacher williges Seu und die Gündt vom vortigen Jabr, in billigem Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1762-06-11",
      "tags_section": "Es wird zum Verkauf angetragen",
      "text": "15. Wo folgende Bücher zu haben, ift im Berichtshaus zu erfragen: Mümferis Cosmographia, Brandes allgemeine Chronica, Medioctis Kirchenhiftorie, Josephus Judiücbe Gejchichten, Steidani Hiftorie, alles wohl gebunden, im Berichtshaus zu erfragen."
    }
  ]
}
